import React from 'react';
import { useNavigate } from 'react-router-dom';

const inspections = [
  { title: 'Hazard Form', formPath: '/form/canteen', image: '/alert2.png' },
  { title: 'Risk Management form', formPath: '/form/fuel', image: '/inc.png' },
];

export default function HazardDashboard() {
  const navigate = useNavigate();

  return (
    <div className="p-6 max-w-7xl mx-auto bg-gray-50 min-h-screen">
      <h1 className="text-2xl font-bold text-gray-800 mb-6">Hazard & Risk Inspections</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {inspections.map((item, index) => (
          <div
            key={index}
            onClick={() => navigate(item.formPath)}
            className="cursor-pointer bg-white shadow rounded-lg p-4 hover:shadow-lg transition"
          >
            <img
              src={item.image}
              alt={item.title}
              className="w-full h-40 object-cover rounded mb-4"
            />
            <h2 className="text-lg font-semibold text-gray-800">{item.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}
